import React from "react";
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';


import logo from "../React/titlelog.png";
import "./SignUp.scss";


const useStyles = makeStyles((theme) => ({
  // root: {
  //   '& > *': {
  //     margin: theme.spacing(1),
  //     width: '35ch',
  //   },
  // },
  input3:{
    width:"130%",
    height:"50px",
    backgroundColor:"#1d2630",
    padding:"0px 0px",
    marginTop:"10px",
    color:"white",


  }



}));





const SignUp = () => {
  const classes = useStyles();
  return (
    <>
      <div className="main_container">
        <div className="centrel_div">
          <div className="img">
            <img className="logo_img" src={logo} alt="Error" />
          </div>
          <div className="heading">
            <h3 className="heading_title">
              Entre Your Details
            </h3>
          </div>
          <div className="inputs">
          <TextField id="filled-basic" label="First Name" variant="outlined"
          style={{ width: "100%", height:'10px', marginBottom: "25px" , padding:"0 14px" }} />
          {/* <input
           type="text"
            name="Last Name"
            className="input2"
            placeholder="Last Name" /> */}
          <TextField id="filled-basic" label="Email Adress" variant="outlined" />
          <TextField id="filled-basic" label="Password" variant="outlined" />
          <TextField
          className={classes.input3}
          id="filled-basic" label="Confirm Password" variant="outlined" />
          <div className="button">
            <button className="submit">CONTINUE</button>
          </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default SignUp;
